def find_non_repeating_elements(arr):
    count = {}
    for num in arr:
        if num in count:
            count[num] += 1
        else:
            count[num] = 1
    non_repeating = [k for k,v in count.items() if v == 1]
    return non_repeating

arr = [1,2,3,2,4,5,5,6,7,8,8,9]
print(find_non_repeating_elements(arr))
